// Mock data for JetSet 101 website

export const mockData = {
  hero: {
    title: "Professional Travel Access",
    subtitle: "Join JetSet 101's IATA-accredited travel platform for exclusive industry discounts and professional advisor opportunities with 70% commission",
    backgroundImage: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4?crop=entropy&cs=srgb&fm=jpg&ixid=M3w3NDk1ODB8MHwxfHNlYXJjaHw4fHx0cm9waWNhbCUyMHBhcmFkaXNlfGVufDB8fHx8MTc1NjY1NDQzM3ww&ixlib=rb-4.1.0&q=85"
  },

  membershipBenefits: [
    {
      icon: "Plane",
      title: "Up to 75% Off Flights",
      description: "Access exclusive flight deals and save thousands on your next adventure",
      savings: "Save up to $2,000 per trip"
    },
    {
      icon: "Hotel",
      title: "40-70% Off Hotels",
      description: "Luxury accommodations at top brands with incredible member discounts",
      savings: "Save $200-500 per night"
    },
    {
      icon: "Ship",
      title: "Cruises from $50/day",
      description: "Sail the world's most beautiful destinations at unbeatable prices",
      savings: "Save $150-300 per day"
    },
    {
      icon: "Users",
      title: "Exclusive Community",
      description: "Connect with fellow travelers and get insider tips from our community",
      savings: "Priceless networking"
    }
  ],

  advisorBenefits: [
    {
      icon: "TrendingUp",
      title: "80% Commission Split",
      description: "Keep 80% of all commissions you generate - industry-leading rates",
      earning: "Earn $1,000-5,000+ monthly"
    },
    {
      icon: "GraduationCap",
      title: "Complete Training Program", 
      description: "Structured certification covering booking, marketing, and business ops",
      earning: "Professional certification"
    },
    {
      icon: "Headphones",
      title: "Full Support System",
      description: "Marketing tools, booking platforms, and dedicated mentor support",
      earning: "Always supported"
    },
    {
      icon: "Globe",
      title: "Supplier Networks",
      description: "Access exclusive partnerships with VIP perks and enhanced commissions",
      earning: "Premium access"
    }
  ],

  howItWorks: {
    membership: [
      {
        step: 1,
        title: "Join the Community",
        description: "Sign up for monthly ($97) or annual ($997) membership",
        icon: "UserPlus"
      },
      {
        step: 2,
        title: "Access Exclusive Deals",
        description: "Browse and book flights, hotels, and cruises at member prices",
        icon: "Search"
      },
      {
        step: 3,
        title: "Save & Travel More",
        description: "Enjoy incredible savings and connect with fellow travelers",
        icon: "Heart"
      }
    ],
    advisor: [
      {
        step: 1,
        title: "Complete Training",
        description: "Master travel industry skills through our certification program",
        icon: "BookOpen"
      },
      {
        step: 2,
        title: "Build Your Business",
        description: "Use our tools, resources, and support to find and serve clients",
        icon: "Building"
      },
      {
        step: 3,
        title: "Earn 80% Commission",
        description: "Keep 80% of all commissions with reliable payment systems",
        icon: "DollarSign"
      }
    ]
  },

  pricing: {
    monthly: {
      price: 97,
      period: "month",
      commitment: "6-month initial commitment",
      savings: "Start earning immediately"
    },
    annual: {
      price: 997,
      period: "year", 
      commitment: "Best Value - Save $176",
      savings: "Lock in professional pricing"
    }
  },

  founderStory: {
    name: "Brandon Torres",
    title: "Founder & CEO",
    story: "As a 40-year-old entrepreneur, family man, and passionate traveler, I've spent my life embracing new cultures and exploring breathtaking destinations. Travel has shaped me both personally and professionally, teaching me resilience, adaptability, and the power of human connection. But I recognized that the biggest obstacle to travel is money - too many people believe travel is a luxury they cannot afford. I refuse to accept this narrative. That's why I created JetSet 101: a travel community designed to break down barriers and make world-class travel more accessible through exclusive discounts, insider deals, and a supportive network of like-minded individuals. My mission is simple - empower people to see more, experience more, and earn more through travel.",
    image: "https://images.unsplash.com/photo-1507679799987-c73779587ccf?crop=entropy&cs=srgb&fm=jpg&ixid=M3w3NTY2NzR8MHwxfHNlYXJjaHwxfHxwcm9mZXNzaW9uYWx8ZW58MHx8fHwxNzU2NjU0NDc2fDA&ixlib=rb-4.1.0&q=85"
  },

  faqs: [
    {
      question: "What is JetSet 101?",
      answer: "JetSet 101 is an exclusive travel membership community that provides members with instant access to exclusive travel discounts on flights, hotels, and cruises, plus opportunities to earn as a travel advisor."
    },
    {
      question: "How much can I save on travel?",
      answer: "Members save up to 75% on flights, 40-70% on hotels at top brands, and enjoy cruises starting at $50 per day, subject to availability."
    },
    {
      question: "What are the membership options?",
      answer: "Monthly Membership: $97/month (requires 6-month initial commitment). Annual Membership: $997/year (Best Value - Save $176 vs monthly)."
    },
    {
      question: "How does the travel advisor program work?",
      answer: "Our travel advisors earn a 80/20 commission split (80% to you) with complete training, marketing support, booking tools, and ongoing mentorship."
    },
    {
      question: "Is there a refund policy?",
      answer: "Monthly memberships are non-refundable. Annual memberships can be refunded within 3 days if no discounts have been used."
    },
    {
      question: "Can I share my membership benefits?",
      answer: "No, JetSet 101 memberships are for individual use only. Sharing credentials may result in membership termination."
    }
  ],

  testimonials: [
    {
      name: "Sarah Johnson",
      role: "Travel Advisor",
      image: "https://images.unsplash.com/photo-1573496359142-b8d87734a5a2?crop=entropy&cs=srgb&fm=jpg&ixid=M3w3NTY2NzR8MHwxfHNlYXJjaHwzfHxwcm9mZXNzaW9uYWx8ZW58MHx8fHwxNzU2NjU0NDc2fDA&ixlib=rb-4.1.0&q=85",
      testimonial: "JetSet 101 transformed my passion for travel into a thriving business. The 80% commission split and incredible support system helped me earn over $4,000 in my first month!"
    },
    {
      name: "Michael Chen",
      role: "JetSet Member",
      image: "https://images.unsplash.com/photo-1507679799987-c73779587ccf?crop=entropy&cs=srgb&fm=jpg&ixid=M3w3NTY2NzR8MHwxfHNlYXJjaHwxfHxwcm9mZXNzaW9uYWx8ZW58MHx8fHwxNzU2NjU0NDc2fDA&ixlib=rb-4.1.0&q=85",
      testimonial: "I saved $1,800 on our family vacation to Europe! The exclusive deals and community support made planning our dream trip so much easier."
    },
    {
      name: "Lisa Rodriguez",
      role: "Travel Advisor",
      image: "https://images.unsplash.com/photo-1573496359142-b8d87734a5a2?crop=entropy&cs=srgb&fm=jpg&ixid=M3w3NTY2NzR8MHwxfHNlYXJjaHwzfHxwcm9mZXNzaW9uYWx8ZW58MHx8fHwxNzU2NjU0NDc2fDA&ixlib=rb-4.1.0&q=85",
      testimonial: "The training program gave me everything I needed to succeed. Now I help others travel better while building my own profitable business from anywhere."
    }
  ],

  stats: [
    { number: "10,000+", label: "Active Members" },
    { number: "75%", label: "Max Flight Savings" },
    { number: "80%", label: "Advisor Commission" },
    { number: "$2M+", label: "Member Savings" }
  ]
};

// Mock form submission handlers
export const mockHandlers = {
  joinMembership: (formData) => {
    console.log('Mock: Joining membership with data:', formData);
    return new Promise(resolve => {
      setTimeout(() => {
        resolve({ success: true, message: 'Welcome to JetSet 101!' });
      }, 1000);
    });
  },

  becomeAdvisor: (formData) => {
    console.log('Mock: Becoming advisor with data:', formData);
    return new Promise(resolve => {
      setTimeout(() => {
        resolve({ success: true, message: 'Advisor application submitted!' });
      }, 1000);
    });
  },

  subscribeNewsletter: (email) => {
    console.log('Mock: Newsletter subscription for:', email);
    return new Promise(resolve => {
      setTimeout(() => {
        resolve({ success: true, message: 'Subscribed to newsletter!' });
      }, 1000);
    });
  },

  contactForm: (formData) => {
    console.log('Mock: Contact form submission:', formData);
    return new Promise(resolve => {
      setTimeout(() => {
        resolve({ success: true, message: 'Message sent successfully!' });
      }, 1000);
    });
  }
};
